b66876e2-2054-4c6c-956b-74bbb77ed369	improvisation	Improv 101: Introduction to Improvisational Comedy	improv101	Learn the beginnings of Chicago-based, long form improv. Students will learn how to create scenes based off of audience suggestions. They will learn: <ul><li>the fundamentals of 'Yes, And'</li><li>how to support scene partners' ideas and energy</li><li>and how to make strong character choices.</li></ul> Absolutely no experience in acting or comedy is needed. The Push Comedy Theater strides to create a fun, safe and supportive experience for all students.<br />At the end of the session, students will take part in a graduation show on the Push Comedy Theater stage.	1	73c632ac-8647-4601-98df-dab94d3acc8d	\N	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293297/covers/wd4vnbdjwchrclmuhomg.png	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
e9bcd9a6-a280-424a-9303-b7bf59f652b9	improvisation	Improv 201: Foundations of the Harold: Game and Second Beats	improv201	This course builds upon the fundamentals and skills learned in 101. Students will learn the beginnings 'The Harold' a long form improvisation structure developed by Del Close. They will learn how to identify the 'game' of a scene and how to heighten these games to develop 'second beats'.<br />At the end of the session, students will take part in a graduation show on the Push Comedy Theater stage.	2	73c632ac-8647-4601-98df-dab94d3acc8d	b66876e2-2054-4c6c-956b-74bbb77ed369	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293298/covers/qphl4uwhh5opshbsjuvl.png	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
b4982f14-bc71-4b7c-bc12-b2e59ea550cc	improvisation	Improv 301: The Harold: Openers and Group Games	improv301	This course continues the Harold work started in 202. Students will delve more deeply into 'The Harold' structure. They will learn a series of 'openers' and 'group games' that will complete the Harold format. Openers are used to derive inspiration from the audience's suggestion while group games are multi person scenes that break up the traditional 2 person scenes.<br />At the end of the session, students will take part in a graduation show on the Push Comedy Theater stage.	3	73c632ac-8647-4601-98df-dab94d3acc8d	e9bcd9a6-a280-424a-9303-b7bf59f652b9	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293299/covers/uyjvypsmg96fcd4zl88j.png	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
9fb3726d-6633-476a-b161-b6a8514a5367	improvisation	Improv 401: Advanced Harold	improv401	Now we put it all together. Students will combine the skills learned in the previous courses for an in depth study of The Harold. This course will delve deeper into the form, focusing on editing scenes, individual and group commitment, as well as the components of 2-person, 3-person, and group scenes.<br />At the end of the session, students will take part in a graduation show on the Push Comedy Theater stage.	4	73c632ac-8647-4601-98df-dab94d3acc8d	b4982f14-bc71-4b7c-bc12-b2e59ea550cc	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293300/covers/vbstqyeecfovcwm3mx9r.png	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
14558bf7-1b9f-41db-95ab-c1abda555ca5	improvisation	Improv 501: Improv Studio	improv501	***THIS COURSE WILL CAP AT 16 STUDENTS*** This course focuses on giving students individual attention to their strengths and weaknesses. We will also break down the different components of improv scenes and the choices that improvisers have and make within those scenes.<br />At the end of the session, students will take part in a graduation show on the Push Comedy Theater stage.	5	73c632ac-8647-4601-98df-dab94d3acc8d	9fb3726d-6633-476a-b161-b6a8514a5367	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293301/covers/hhlz9x5qcz2qqkk3xyga.png	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
6b8b6999-8829-4afe-a68b-a6ee62ae13b7	improvisation	Kidprov 101	kidprov101	Don't miss out on the fun!!! Sign up your kids, grand kids, nieces, nephews, even the stinky neighbor kid from down the street for KidProv at the Push Comedy Theater.<br />This class is open to children ages 8 to 12. Students will explore the key elements of both long and short form improvisation. The children will play numerous improv games which will serve to develop and enhance their public-speaking, social and team-building skills.<br />This class will be conducted in a non-judgmental environment where the students will build confidence, make friends and most importantly ... have fun<br />The session concludes with the students performing in a graduation show on the Push Comedy Theater Stage.<br />This is class is $150 for new students and $140 for returning students.<br />New students also receive a free tshirt.	6	73c632ac-8647-4601-98df-dab94d3acc8d	\N	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293302/covers/g0upzsg4dchanai2ul0l.jpg	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
41455fcd-2a2e-4bdf-b5de-af50d3c99128	improvisation	Kidprov 201	kidprov201	Don't miss out on the fun!!! Sign up your kids, grand kids, nieces, nephews, even the stinky neighbor kid from down the street for KidProv at the Push Comedy Theater.<br />This class is open to children ages 8 to 12 who have previously taken at least 2 sessions of KidProv 101. Students will explore the key elements of both long and short form improvisation. The children will play numerous improv games which will serve to develop and enhance their public-speaking, social and team-building skills.<br />This class will be conducted in a non-judgmental environment where the students will build confidence, make friends and most importantly ... have fun<br />The session concludes with the students performing in a graduation show on the Push Comedy Theater Stage.<br />This class is $150.	7	73c632ac-8647-4601-98df-dab94d3acc8d	6b8b6999-8829-4afe-a68b-a6ee62ae13b7	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293303/covers/orrcrhg9bcgnexgseitw.jpg	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
530759c6-24d2-45cf-a6a2-aaefc402bd3e	improvisation	Musical Improv 101	music_improv101	This is what you've been waiting for! The Push Comedy Theater brings you MUSICAL IMPROV!!!<br />This course offers an introduction to long form musical improvisation. We will cover the basics of how to work with music while learning how to create two person musical numbers, placing them together to create a 15 minute thematic musical show.<br />Additional focus will be on sound exploration, movement, stylization, and accessing voice. Prepare to challenge yourself while having a ton of fun! This course culminates with a graduation show.	8	73c632ac-8647-4601-98df-dab94d3acc8d	b66876e2-2054-4c6c-956b-74bbb77ed369	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293304/covers/vggfmhm2c99mhkxi7r7v.jpg	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
ac0dde68-43b7-4c86-aab6-94c43e51fd13	improvisation	Musical Improv 201	music_improv201	This class is focused on building a long form Musical Harold. It will improve upon the concepts and skills learned in Musical Improv 101, with a focus on finding deeper relationships and themes to bring to life through song.	9	73c632ac-8647-4601-98df-dab94d3acc8d	530759c6-24d2-45cf-a6a2-aaefc402bd3e	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293305/covers/rxu5yn34d5rp0nvnkssf.jpg	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
fda71839-c860-4ceb-994a-6c5c6fc88d7b	improvisation	Musical Improv Studio	music_improv_studio	This course builds on what is learned in Musical Improv 101 and 201. We will work together on creating new forms and building skills for more varied and interesting scenes and songs.<br />Together, we will create a thematic musical form that will be the structure for our graduation show.	10	73c632ac-8647-4601-98df-dab94d3acc8d	ac0dde68-43b7-4c86-aab6-94c43e51fd13	https://res.cloudinary.com/push-comedy-theater/image/upload/v1508021107/covers/yes_yfvtxd.jpg	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
1c9089ee-737d-449b-81f7-90543b64b164	sketch	Sketch Comedy Writing 201	sketch201	This course builds upon the fundamentals and skills learned in 101.<br />At the end of the session, students sketches will be performed on the Push Comedy Theater stage by some of Hampton Roads finest actors.	2	73c632ac-8647-4601-98df-dab94d3acc8d	948a94a3-3889-4c9e-8be8-86f0f77c2f32	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293308/covers/wk3zfokdjzhpxpfsrgxx.jpg	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
dd14f52b-17f3-4b6a-9cde-c1738e73481b	improvisation	Improv for Teens	teen_improv	Jump head first into the wonderful worlds of sketch and improv comedy. This class is open to teens from the ages of 13 to 18. Absolutely no experience is needed. Students will explore the key tools behind both long and short form improvisation. We will play numerous games to help you sharpen your mind. We will then use improv as a springboard for writing basic comedy sketches- like those seen on SNL. We strive to create a safe, non-judgmental environment where teens can build confidence, make friends and most importantly... have fun.<br />At the end of the session, students will take part in a graduation show on the Push Comedy Theater stage.	11	73c632ac-8647-4601-98df-dab94d3acc8d	\N	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293306/covers/s9uyzugyefwu81hmicmb.jpg	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
948a94a3-3889-4c9e-8be8-86f0f77c2f32	sketch	Sketch Comedy Writing 101	sketch101	Dive head first into the wonderful world of sketch comedy! Whether you're a seasoned writer or someone who rarely picks up a pen, this class will teach how to get the funny ideas out of your head and onto the page. In this class we will examine the various types of sketches, learn how to generate funny ideas and then turn them into a sketches ready for the stage. This class is open to everyone, no writing or comedy experience is ready.<br />At the end of the session, students sketches will be performed on the Push Comedy Theater stage by some of Hampton Roads finest actors.	1	73c632ac-8647-4601-98df-dab94d3acc8d	\N	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293307/covers/nfshrdoaapy0pcsqayru.png	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
59ea6e9e-682a-4cae-9e6f-a3d0a242b8dd	standup	Standup 101	standup101	Learn how to perform stand-up comedy!<br />Learn about the often-overlooked basics of stand-up comedy and the nuances of fine tuning your act from almost-jaded veteran comic Hatton Jordan.<br />This class focuses on learning three skills:<br /><ul><li>HOW to craft an original set,</li><li>HOW to host a show like a pro</li><li>HOW to market yourself so club bookers will want to pay you.</li></ul><br />This course culminates with YOU and the others in your class performing your set at your Grad Show at the Push Theater.<br />The class will be a 6 week course ending with a graduation show at the 90 seat Push Comedy Theater.	1	73c632ac-8647-4601-98df-dab94d3acc8d	\N	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293309/covers/sxdcjtuvqwxkwyraic4x.jpg	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
19eb1733-4f8c-4f4a-930c-36937324fb97	acting	Acting 101	acting101	This foundational course introduces the basic principles of acting through improvisation, monologue, scene work, and technical methods in voice, physical action, and text analysis. It involves fundamental skills and techniques with an emphasis on physical/vocal awareness, spontaneity, concentration, and truthful response.	1	73c632ac-8647-4601-98df-dab94d3acc8d	\N	https://res.cloudinary.com/push-comedy-theater/image/upload/v1507293310/covers/hgjkgz1oh1qqjrqznljt.png	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
