b017cd03-7dd3-4208-83a0-b59edb4144aa	JL18Y9	Tell Me More Storytelling	<p>Suggested theme: Smell<br><br>Join us 7 p.m. Dec. 17 at the Push Comedy Theater for a night of stories. This month the theme is "smell." Storytellers to be announced. Admission: $5.<br><br>Want to tell a story? Visit <a href="https://l.facebook.com/l.php?u=http%3A%2F%2Fwww.tellmemorelive.org%2Fpitch&amp;h=ATM8uKh5nwl4N69YVVQcgfhmXbyIqJ9-qdiBHnVpduAeOmAjz3xD871ArFwkw934424WfZ2a4g84y1k1rZTVTRk499fyK0bjmtQOw4hRuThkTGhdX9FJlvZ4v4P1cWdEveFskkNFp46qZ0HUqo-qJPjCWg&amp;enc=AZMUEFm0cXrM5DbqWWyXul5gE-gMcpnAn1uNpQoCtjY2_BLzEOg5v4uJpUbtQ5cegoY&amp;s=1" rel="nofollow" target="_blank">www.tellmemorelive.org/<wbr>pitch</wbr></a>. Call (757) 785-5590. Or email submit@tellmemorelive.org.<br><br>Time: 7 p.m.<br>Date: Sunday, January 21st, 2018<br>Location: Push Comedy Theater, 763 Granby Street, Norfolk<br>Admission: $5\n</p>\n	active	2018-01-22 00:00:00+00	2018-01-22 01:30:00+00	t	d648bc9a-123a-478e-b2c9-1711b1c928dd	6407e338-f33a-4447-bb3c-03e8ed3cce4e	\N	2018-01-25 19:14:42+00	2018-01-25 19:14:42+00
c62d098c-bfbd-4c6d-8830-81ee06a50e23	P42DB7	Date Night: With Brad McMurran and Alba Woolard	<p><strong>Get ready as we improvise your relationship.</strong>\n</p>\n<p>It's the most fun you'll ever have on date night!\n</p>\n<p>Two lucky couples will see their love unfold on stage through the interpretation of 2 of Hampton Roads' wackiest improvisers!\n</p>\n<p>The couples will be selected at random and interviewed on stage in front of the audience. Using the information they learn, and their imagination, Brad and Alba will show the story of the couples' love.\n</p>\n<p>For years, The Pushers have been getting to know diverse couples all across Hampton Roads with this signature piece. Normally this is a piece within a larger show. This time, Brad and Alba are out to explore as much as possible by bringing it to you as its own show!\n</p>\n<p><br>\n</p>\n<p><strong>Date Night: With Brad and Alba</strong>\n</p>\n<p>Friday, February 2nd at 8pm\n</p>\n<p>Tickets are $5\n</p>\n<p>---\n</p>\n<p>The Pushers are Virginia's premiere sketch and improv comedy group. For more than 11 years they have thrilled (and shocked) audiences with their wild antics both on and off stage. The group puts on a racy, high-octane, energetic show that is guaranteed to have audiences howling with laughter. In November of 2014, they opened their own theater, The Push Comedy Theater, located in the new Norfolk Arts District.\n</p>\n<p>In 2013 The Pushers' Off-Broadway musical Cuff Me: The Unauthorized Fifty Shades of Grey Musical Parody debuted in New York City. It ran for over a year in both New York and Chicago. A third production is currently touring the country.\n</p>\n<p>The Pushers have appeared at both The Charleston Comedy Festival and The North Carolina Comedy Arts Festival. In New York, they have performed at The People's Improv Theater, The Upright Citizen's Brigade and at The Kraine Theater in New York's East Village.\n</p>\n<p>Here in Hampton Roads the group have performed most notably at The Jewish Mother, The NorVa and The Virginia Beach Funnybone.\n</p>\n<p>---\n</p>\n<p>The Push Comedy Theater is a 99 seat venue in the heart of Norfolk's brand new Arts District. Founded by local comedy group The Pushers, the Push Comedy Theater is dedicated to bringing you live comedy from the best local and national acts.\n</p>\n<p>The Push Comedy Theater hosts live sketch, improv and stand-up comedy on Friday and Saturday nights. During the week classes are offered in stand-up, sketch and improv comedy as well as acting.\n</p>\n<p>Whether you're a die-hard comedy lover or a casual fan... a seasoned performer or someone who's never stepped foot on stage... the Push Comedy Theater has something for you.\n</p>\n	active	2018-02-03 01:00:00+00	2018-02-03 02:30:00+00	t	d648bc9a-123a-478e-b2c9-1711b1c928dd	5b9f6181-cd3d-47b9-9d9f-7222630bc8f4	\N	2018-01-25 19:15:19+00	2018-01-25 19:15:19+00
97773be6-1155-4b97-b47f-0f25d6678d81	LM4GXV	Class Dismissed: The Improv 201 Graduation Show	<p><strong></strong><strong>Dust off those caps and gowns... because it's graduation time at the Push.</strong>\n</p>\n<p>Check out the Push Comedy Theater's Improv 201 class as they show off their comedy chops.\n</p>\n<p>Watch as these brave 201 souls dive head first into the wonderful world of The Harold. So who the heck is Harold? More accurately the question should be... what the heck is a Harold?\n</p>\n<p>The Harold is perhaps the best know style of long form improv. It starts with an audience suggestion, then improvisers weave together scenes, characters and group games to create a seamless piece. It can be bizarre and magical, baffling and amazing... it definitely needs to be seen.\n</p>\n<p><strong>Class Dismissed: The Improv 201 Graduation Show </strong><br>Monday, January 22nd at 7pm<br>Tickets are $5\n</p>\n<p>The Push Comedy Theater only has 99 seats, so we recommend you get your tickets in advance.\n</p>\n<p>Free parking available at Slone Chiropractic (111 W Virginia Beach) just one block from the theater. There is also limited parking on the street.\n</p>\n	active	2018-01-23 00:00:00+00	2018-01-23 01:30:00+00	t	d648bc9a-123a-478e-b2c9-1711b1c928dd	a93534fc-6af6-4525-b6cc-586d0b9a2952	\N	2018-01-25 19:12:52+00	2018-01-25 19:12:52+00
1835351b-080e-4078-bc92-33e2ca404382	WDYFLQ	On the House Presents:  Lee Jackson King Pitbull Skrillex Day!	<p>Come celebrate January’s most bizarre holiday with some hilarious sketch comedy from your friends at On The House.  The group exploded onto the sketch comedy scene with a revelatory performance to a boisterous audience of twelve people in the middle of a blinding snowstorm, thereby winning the first of three consecutive Sketchamageddon championships.\n</p>\n<p>Based on this rousing success, On The House was named the group most likely to perform on Friday, January 19th, 2018 at 10pm at the Push Comedy Theater.  <br>\n</p>\n<p>One thing’s for sure; this crazy, funny family of dysfunctional young comedians (plus one older guy) will have you rolling in the aisles.\n</p>\n<p>As a special bonus; if your first or last name is Lee, Jackson, King, Pitbull, or Skrillex, you will be feted with appropriate honors during the performance.\n</p>\n	active	2018-01-20 03:00:00+00	2018-01-20 04:30:00+00	t	d648bc9a-123a-478e-b2c9-1711b1c928dd	5be156fe-b41e-4e7b-953c-de78641f824b	\N	2018-01-25 19:12:58+00	2018-01-25 19:12:58+00
