COPY teachers (id, slug, name, email, biography, social, inserted_at, updated_at) FROM stdin;
19ddcedb-e8be-49f7-bf07-08819e2af252	alba_woolard	Alba Woolard	alba@pushcomedytheater.com	<p>Alba has been a performer and writer for the sketch and improv comedy group The Pushers since the summer of 2009. As a member of the group, she also produces and directs "Panties in a Twist: The All Female Sketch Comedy Show."</p><p>She graduated with a BFA in Acting from Old Dominion University. She has studied Improv with the Pushers and several regional improvisers. With the Pushers, she has performed up and down the east coast. By day, Alba is a Standardized Patient Educator at Eastern Virginia Medical School.</p>	{}	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
f4fc7f5b-c292-47db-9b6a-eff97acc2e9a	brad_mcmurran	Brad McMurran	brad@pushcomedytheater.com	<p>Brad McMurran is the founder of The Pushers Sketch and Improvisation Comedy Troupe. He is the co-head writer, performer, and artistic director of the Push Comedy Theater.</p><p>Brad studied acting in college, trained in improvisation at Upright Citizen's Brigades, and is the co-writer of Cuff Me; The 50 Shades of Grey Musical Parody (which played off-broadway in New York for the past year).</p><p>Brad has been writing sketch comedy for ten years and is pleased as a pickle to be opening up this theater in Hampton Roads. McMurran is a graduate of Old Dominion and enjoys pizza.</p>	{"twitter": "https://twitter.com/Brad_ThePushers", "facebook": "https://www.facebook.com/bradmcmurran"}	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
885302c6-daeb-48e7-b556-4262568c419b	ed_carden	Ed Carden	ed@pushcomedytheater.com	<p>Ed Carden has been acting and performing comedy for more than a decade, and has appeared in nearly 30 local theatrical productions, as well as a handful of commercials and short films.</p><p>He is a founding member of The Pushers Sketch/Improv Comedy Group, in which he serves as a performer, writer, and producer. With The Pushers, he has performed up and down the east coast.</p><p>By day he works for Virginia Beach Public Schools. In addition to writing and performing, he enjoys cheeseburgers, sushi, and science fiction—not necessarily in that order.</p>	{"twitter": "https://twitter.com/TheEdCarden"}	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
483c4ba5-9062-418c-9ed1-842ef23907d2	sean_devereux	Sean Devereux	sean@pushcomedytheater.com	<p>Sean Devereux is an original member of The Pushers, and has been performing and writing comedy for nearly ten years.</p><p>Sean studied improv at the Upright Citizens Brigade Theater in New York and is one of the co-writers of the Off-Broadway hit Cuff Me: The Fifty Shades of Grey Musical Parody. In his civilian guise, Sean is an Emmy award winning writer and producer at WVEC-TV13.</p>	{"twitter": "https://twitter.com/Sean_ThePushers"}	2018-01-25 19:12:05+00	2018-01-25 19:12:05+00
\.
